import React from 'react'

export default function Waiting() {
    return (
        <div style={{
            height: "100vh",
            display: "flex",
            alignItems: "center",
            alignContent: "center",
            justifyContent: "center",
            background: "radial-gradient(circle, #1f1f1f 40%, darkblue 40%, midnightblue 45%, #1f1f1f 45%)",
        }}>
            <h1 style={{
                color: "darkgrey",
                fontSize: "50px",
                margin: "0px",
                position: "absolute",
                top: "50%",
                left: "50%",
                transform: "translate(-50%, -50%)",
                fontWeight: "bold",
            }}>Vote Caste :)...</h1>
        </div>
    )
}
